import logo from './logo.svg';
import './App.css'; 
import NavScrollExample from './navbar'
// import { Navbar } from 'react-bootstrap'; 
// import { Carousel } from 'react-bootstrap'; 
import IndividualIntervalsExample  from './carousel';

function App() {
  return ( 
    <>
      <NavScrollExample/>    
      <tr>
                    <td width="20%">Kualitas Bangunan</td>
                    <td>
                        <select {...register('id_jenis_bangunan')} onChange={onchange_jenis_bangunan} value={selected_jenis_bangunan}>
                                    <option value={''}></option>
                                    {jenis_bangunan && jenis_bangunan.map((jb , index_jb)=>(
                                        <option value = {jb.id}>{jb.nama_jenis_bangunan}</option>
                                    ))}
                         </select>
                    </td>
                </tr>
                <tr>
                    <td width="20%">Kelas Bangunan</td>
                    <td>
                        <select {...register('kelas_bangunan')} onChange = {onchange_kelas_bangunan} value={selected_kelas_bangunan}>
                                    <option value={''}></option>
                                    {kelas_bangunan && kelas_bangunan.map((kb , index_kb)=>(
                                        <option value = {kb.kelas_bangunan}>{kb.kelas_bangunan}</option>
                                    ))}
                         </select>
                    </td>
                </tr>
    </>

  );
}

export default App;
